package main

import (
    "encoding/hex"
    "fmt"

    "github.com/dbnski/dblenc/dblenc"
)

func main() {
    tests := []string{
        "616C61206D61206B6F746120",
        "C2A72EE280A2C2B4C2A827C2B0C3B7E280A22E2EC397202020F09F8E802020F09D929EF09D92BDF09D92B6F09D9387F09D92B6F09D92B8F09D9389F09D9192F09D9387F09D93887E2020F09F8E80202020C3972E2EE280A2C3B7C2B027C2A8C2B4E280A22EC2A7",
        "",
        "417461743FC383E280B0C382C2ACC382C2BA726B",
        "C382C2B9C382C2AA206665636861206465206C61204C6967612052696F20",
        "C3A0C2A6E280A0C3A0C2A6C59320C3A0C2A6C2ACC3A0C2A6C2BFC3A0C2A6C2B6C3A0C2A7C28DC3A0C2A6C2AC20C3A0C2A6C2ADC3A0C2A6C2BEC3A0C2A6C2B2C3A0C2A6C2ACC3A0C2A6C2BEC3A0C2A6C2B8C3A0C2A6C2BE20C3A0C2A6C2A6C3A0C2A6C2BFC3A0C2A6C2ACC3A0C2A6C2B8",
        "436975646164206465204C65C383C2B36E",
        "",
        "E5A4A7E78886E799BA",
        "C3A5C2A4C2A7C3A7CB86E280A0C3A7E284A2C2BA",
        "C3A5C2A4C2A7C3A7CB86E280A0C3A7E284A2",
        "C3A5C2A4C2A7C3A7CB86E280A0C3A7",
        "C383C692C382C2A5C383E2809AC382C2A4C383E2809AC382C2A7C383C692C382C2A7C383E280B9C3A2E282ACC2A0C383C2A2C3A2E2809AC2ACC382C2A0C383C692C382C2A7C383C2A2C3A2E282ACC5BEC382C2A2C383E2809AC382C2BA",
        "C383C692C382C2A5C383E2809AC382C2A4C383E2809AC382C2A7C383C692C382C2A7C383E280B9C3A2E282ACC2A0C383C2A2C3A2E2809AC2ACC382C2A0C383C692C382C2A7C383C2A2C3A2E282ACC5BEC382C2A2C383E2809AC382",
        "C383C692C382C2A5C383E2809AC382C2A4C383E2809AC382C2A7C383C692C382C2A7C383E280B9C3A2E282ACC2A0C383C2A2C3A2E2809AC2ACC382C2A0C383C692C382C2A7C383C2A2C3A2E282ACC5BEC382C2A2C383E2809A",
    }

    m := dblenc.NewUnDoubleEncoder()
    for _, test := range tests {
        b, err := hex.DecodeString(test)
        if err != nil {
            panic(err)
        }

        o, err := m.Transform(b)
        if err != nil {
            panic(err)
        }
        fmt.Printf("in: %s\nout: %s\n\n", b, o)
    }
}
